import React from 'react';
import { Route, Redirect } from 'react-router-dom';
import  isLogged  from './isLogged';

const PublicRoute = ({component: Component, restricted}) => {
    return (
        <Route render={props => (
            isLogged && restricted ?
                <Redirect to="/" />
            : <Component {...props} />
        )} />
    );
};

export default PublicRoute;
